import React from 'react';
import './App.css';

const MovieApp = _ => {

  async function fetchMovies() {
    const response = fetch()
  }

  useEffect( _ => {
    fetchMovies();
  }, [])

  return (
    <div className="movie-container">
      Movies
      <input type="text" />
    </div>
  )
}

export default MovieApp;
